        "def solution(new_id):\n",
        "  new_id = str(new_id).lower()\n",
        "  step2 = ''\n",
        "  for i in new_id:\n",
        "    if i.isalnum() or i in '-_.':\n",
        "      step2 += i\n",
        "  while '..' in step2:\n",
        "    step2 = step2.replace('..', '.')\n",
        "  new_id = step2\n",
        "  new_id = new_id.replace('=', '')\n",
        "  if new_id[-1] == '.':\n",
        "    new_id = new_id[:-1]\n",
        "  if new_id != \"\" and new_id[0] == '.':\n",
        "    new_id = new_id[1:]\n",
        "  if new_id == '':\n",
        "    new_id = 'a'\n",
        "  if len(new_id) >= 15:\n",
        "    new_id = new_id[:15]\n",
        "  if new_id[-1] == '.':\n",
